import React from 'react'
import Box from '@mui/material/Box';
import { Button } from '@mui/material';

export function NavBar() {
    return (
        <div>
            <Box
                sx={{
                    width: "100%",
                    height: 50,
                    backgroundColor: '#E3E3E3',
                }}
            />
            <Button variant="contained">SignUp</Button>
        </div>
    )
}
